import CreateAccountForm from './CreateAccountForm'
import Button from 'react-bootstrap/Button'

const Pupup = (porps: {closePopup: void}) =>{
  return(
    <div className='popUp'>
    <CreateAccountForm/>
    <Button onClick={this.props.closePopup}className='cancelPopup' variant='danger'>Cancel</Button>
    </div>
  )
}

export default Pupup
